namespace RonSijm.FluidHumidifier.Factories.QuickSight;

public class DataSourceFactory(string resourceName = null, Action<Humidifier.QuickSight.DataSource> factoryAction = null) : ResourceFactory<Humidifier.QuickSight.DataSource>(resourceName)
{

    internal List<InnerDataSourceDataSourceParametersFactory> AlternateDataSourceParametersFactories { get; set; } = [];

    internal List<InnerDataSourceResourcePermissionFactory> PermissionsFactories { get; set; } = [];

    internal InnerDataSourceDataSourceParametersFactory DataSourceParametersFactory { get; set; }

    internal InnerDataSourceVpcConnectionPropertiesFactory VpcConnectionPropertiesFactory { get; set; }

    internal InnerDataSourceDataSourceErrorInfoFactory ErrorInfoFactory { get; set; }

    internal InnerDataSourceSslPropertiesFactory SslPropertiesFactory { get; set; }

    internal InnerDataSourceDataSourceCredentialsFactory CredentialsFactory { get; set; }

    protected override Humidifier.QuickSight.DataSource Create()
    {
        var dataSourceResult = CreateDataSource();
        factoryAction?.Invoke(dataSourceResult);

        return dataSourceResult;
    }

    private Humidifier.QuickSight.DataSource CreateDataSource()
    {
        var dataSourceResult = new Humidifier.QuickSight.DataSource
        {
            GivenName = InputResourceName,
        };

        return dataSourceResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.DataSource result)
    {
        base.CreateChildren(result);

        result.AlternateDataSourceParameters = AlternateDataSourceParametersFactories.Any() ? AlternateDataSourceParametersFactories.Select(x => x.Build()).ToList() : null;
        result.Permissions = PermissionsFactories.Any() ? PermissionsFactories.Select(x => x.Build()).ToList() : null;
        result.DataSourceParameters ??= DataSourceParametersFactory?.Build();
        result.VpcConnectionProperties ??= VpcConnectionPropertiesFactory?.Build();
        result.ErrorInfo ??= ErrorInfoFactory?.Build();
        result.SslProperties ??= SslPropertiesFactory?.Build();
        result.Credentials ??= CredentialsFactory?.Build();
    }

} // End Of Class

